Sets the entity to be leashed to.

@param entityIn The entity to be tethered to
@param sendAttachNotification Whether to send an attaching notification packet to surrounding players.

Returns true if the item can be used on the given entity, e.g. shears on sheep.

@param stack the item stack of the item being used
@param player the player who used the item
@param target the target we hit with the item in hand

Breaks the block at the given location. Args: x, y, z, dropBlock.

@param x The X co-ordinate for the block
@param y The Y co-ordinate for the block
@param z The Z co-ordinate for the block
@param dropBlock If the block should be dropped in-world

Renders a standard cube block at the given coordinates

@param blockType the type of block that is rendered
@param blockX x-coordinate of the block
@param blockY y-coordinate of the block
@param blockZ z-coordinate of the block

Wake up the player if they're sleeping.

@param updateWorldFlag Updates World.allPlayersSleeping on the server
@param setSpawn Set the (re)spawn point for the player

Play a sound effect. Many many parameters for this function. Not sure what they do, but a classic call is : (double)i + 0.5D, (double)j + 0.5D, (double)k + 0.5D, 'random.door_open', 1.0F, world.rand.nextFloat() * 0.1F + 0.9F with i,j,k position of the block.

@param soundName Name of sound (example: random.orb)
@param pitch Example: world.rand.nextFloat() * 0.1F + 0.9F

Handles slot click. Args : slotId, clickedButton, mode (0 = basic click, 1 = shift click, 2 = Hotbar, 3 = pickBlock, 4 = Drop, 5 = ?, 6 = Double click), player

@param slotId Will be either the slot id in the current Container or -999 if dragging
@param mode 0 for basic click, 1 for shift-click, 2 for hotbar, 3 for pickBlock, 4 for drop, 5 for item distribution drag, 6 for double click

Returns a list of integer values generated by this layer. These may be interpreted as temperatures, rainfall amounts, or biomeList[] indices based on the particular GenLayer subclass.

@param areaX The x-position of the area
@param areaY The y-position of the area
@param areaWidth The width of the area
@param areaHeight The height of the area

Gets the vanilla armor Item that can go in the slot specified for the given tier.

@param armorSlot The armor slot number (1-4)
@param itemTier Vanilla item material tier (0=leather, 1=gold, 2=chain, 3=iron, 4=diamond)
